import React from 'react'

const LongCopy = () => {
    return(
        <div className="longcopy transition">
            <div className='lc-body robo200'>
                <div className='lc-body-span'>Sports Betting is rigged in favor of the sportsbooks.</div> 
                <div className='lc-body-span'>SimBull is a long term market to eliminate the sportsbook's edge and give you back the upperhand. </div> 
                <div className='lc-body-span'>You can trade teams like stocks and earn cash everytime your teams win.</div> 
            </div>
        </div>
    )
}

export default LongCopy
